import React from 'react'
import styled from "styled-components"

function header() {
    return (
        <Container>

        <a href = "/"> 
          <img src = "/images/logo.svg" alt="" />
        </a>

        <Menu>
        <p>
        <a href="/">Model S</a>
        <a href="/">Model 3</a>
        <a href="/">Model X</a>
        <a href="/">Model Y</a>

        </p>

        </Menu>

        </Container>
    )
}

export default header


const Container = styled.div`

min-height: 60px;
position: fixed;
display: flex;
align-items: center;
padding: 0 20px;
`

const Menu = styled.div`
display: flex;
align-items: center;

p{
    font-weight: 600;
    text-transform: uppercase;
    padding: 0 10px;
    flex-wrap: nowrap;
}



`
